import styled from "styled-components";
import '../App.css';
import { Link, useLocation } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import React from "react";



const HeaderContainer = styled.div`
  background-color: #A0CED9;
  height: 60px;
  .row{
    margin: unset;
    height: 100%;
  }
  .col-md-9{
    display: flex;
    align-items: center;
    justify-content: center;
  }
  .col-md-3{
    display: flex;
    align-items: center;
    justify-content: space-evenly;
  }
  a{
    padding: 0 15px;
    background-color: #1F2041;
    color: white;
    font-size: 20px;
    text-decoration: none;
  }
  a:hover{
    padding: 2px 25px;
    background-color: blueviolet;
    transition: 1000ms;
    color: white;
    font-size: 20px;
    text-decoration: none;
  }
`

function useQuery() {
  const { search } = useLocation();
  return React.useMemo(() => new URLSearchParams(search), [search]);
}

const Header = () => {

  let query = useQuery()
  


  return (
    <HeaderContainer>
      <Row>
        <Col md={9}>
          <Link to='/SignIn'>Правила использования</Link>
        </Col>
        <Col md={3}>
          <Link onClick={() => console.log(query.get('overflow')) } to='/SignIn?overflow=0'>Войти</Link>
          <Link onClick={() => console.log(query.get('overflow')) } to='/SignUp?overflow=1'>Регистрация</Link>
        </Col>     
      </Row>
    </HeaderContainer>
  );
}

export default Header;
